schemaDefinition: "create or replace view U_LMS_REGISTRATION(\n\t\"LMSRegisCourseID\"\
  ,\n\t\"LMSRegisCourseTitle\",\n\t\"LMSRegisPerOrganizationName\",\n\t\"LMSRegisPerFullName\"\
  ,\n\t\"LMSRegisPersUserName\",\n\t\"LMSRegisCountry\",\n\t\"LMSRegisCompletedCourceMarkedComplete\"\
  ,\n\t\"LMSRegisCourceActivityStatus\",\n\t\"LMSPersonDomain\",\n\t\"LMSClassId\"\
  ,\n\t\"LMSOrderNumber\",\n\t\"LMSClassDeliveryName\",\n\t\"LMSCourseAssignedBySourceType\"\
  ,\n\t\"LMSCourseAssignedByAllSources\",\n\t\"LMSRegistrationStatus\",\n\t\"LMSRegistrationDate\"\
  ,\n\t\"LMSCompletionStatus\",\n\t\"LMSCompletedCoursesStatus\",\n\t\"LMSCompletedCourcesScore\"\
  ,\n\t\"LMSIsCourseOverdue\",\n\t\"LMSCourseAssignedOn\",\n\t\"LMSPersonOrganizationNumber\"\
  ,\n\t\"LMSCourseOverDueByDays\",\n\t\"LMSIsLearningMandatory\"\n) as -- SEMANTIC\
  \ LAYER BEGINS\n\nSELECT \"U_COURSE_ID\" as \"LMSRegisCourseID\",\n       \"U_COURSE_TITLE\"\
  \ as \"LMSRegisCourseTitle\",\n       \"U_PERSON_ORGANIZATION_NAME\" as \"LMSRegisPerOrganizationName\"\
  ,\n       \"U_PERSON_FULL_NAME\" as \"LMSRegisPerFullName\",\n       \"U_PERSON_USERNAME\"\
  \ as \"LMSRegisPersUserName\",\n       \"U_COUNTRY\" as \"LMSRegisCountry\",\n \
  \      \"U_COMPLETED_COURSES_MARKED_COMPLETE\" as \"LMSRegisCompletedCourceMarkedComplete\"\
  ,\n       \"U_COURSE_ACTIVITY_STATUS\" as \"LMSRegisCourceActivityStatus\",\n  \
  \     \"U_PERSON_DOMAIN\" as \"LMSPersonDomain\",\n       \"U_CLASS_ID\" as \"LMSClassId\"\
  ,\n       \"U_ORDER_NUMBER\" as \"LMSOrderNumber\",\n       \"U_CLASS_DELIVERY_NAME\"\
  \ as \"LMSClassDeliveryName\",\n       \"U_COURSE_ASSIGNED_BY_SOURCE_TYPE\" as \"\
  LMSCourseAssignedBySourceType\",\n       \"U_COURSE_ASSIGNED_BY_ALL_SOURCES\" as\
  \ \"LMSCourseAssignedByAllSources\",\n       \"U_REGISTRATION_STATUS\" as \"LMSRegistrationStatus\"\
  ,\n       \"U_REGISTRATION_DATE\" as \"LMSRegistrationDate\",\n       \"U_COMPLETION_STATUS\"\
  \ as \"LMSCompletionStatus\",\n       \"U_COMPLETED_COURSES_STATUS\" as \"LMSCompletedCoursesStatus\"\
  ,\n       \"U_COMPLETED_COURSES_SCORE\" as \"LMSCompletedCourcesScore\",\n     \
  \  \"U_IS_COURSE_OVERDUE\" as \"LMSIsCourseOverdue\",\n       \"U_COURSE_ASSIGNED_ON\"\
  \ as \"LMSCourseAssignedOn\",\n       \"U_PERSON_ORGANIZATION_NUMBER\" as \"LMSPersonOrganizationNumber\"\
  ,\n       \"U_COURSE_OVERDUE_BY_DAYS\" as \"LMSCourseOverDueByDays\",\n       \"\
  U_IS_LEARNING_MANDATORY\" as \"LMSIsLearningMandatory\"\nFROM \"RDS\".\"SURF\".\"\
  U_LMS_REGISTRATIONS\";"
